import React from "react";
import Cards from "./Cards";
import Sdata from "./SData";

const Netflix=()=>{
    return(  
        <Cards
        key = {Sdata[0].id}
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        SName={Sdata[0].SName}
        refrence={Sdata[0].refrence}
        />);
}
export default Netflix;
